import React from "react";
import Menu from "./Menu";
import Links from "./Links";

import {
  MainContainer,
  StyledDiv1,
  Name,
  StyledDiv2,
  Cactus,
  MenuDiv,
  CactusTooltip
} from "./styles/App";

function App() {
  return (
    <MainContainer>
      <StyledDiv1>
        <Name>katherine szelag</Name>
        <CactusTooltip title="pretty fly for a cacti" placement="right" arrow>
          <Cactus
            alt="cactus"
            src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583435278/cactus_3_dykbla.svg"
          />
        </CactusTooltip>
      </StyledDiv1>
      <StyledDiv2>
        <Links />
        <MenuDiv>
          <Menu />
        </MenuDiv>
      </StyledDiv2>
    </MainContainer>
  );
}

export default App;
